import React, { Component } from "react";
const Listgroup = ({ mission_ids }) => {
  return (
    <React.Fragment>
      <h5>Mission ids</h5>
      <ul class="list-group ">
        {Object.values(mission_ids).map((item) => (
          <li className="list-group-item">{item}</li>
        ))}
      </ul>
    </React.Fragment>
  );
};

export default Listgroup;
